import React from 'react';
import TextField from '@material-ui/core/TextField';

class Signup extends React.Component{
    constructor(){
        super ()
        this.state = {
            username : '',
            email : '',
            password : '',
            confirmPassword : '',
        }
    }

    render (){
        return(
            <div>   
                <TextField 
                    id="outlined-password-input"
                    label="Username"
                    type="text"
                    margin="normal"
                    variant="outlined"
                />
            </div>
        )
    }
}

export default Signup;
